    can_accept_calls: "bool" = False
    type: "SessionType | None" = None
    api_id: "int" = 0
    application_name: "str" = ""
    application_version: "str" = ""
    is_official_application: "bool" = False
    device_model: "str" = ""
    platform: "str" = ""
    system_version: "str" = ""
